// Example component where you want to fetch vehicle types based on number of wheels
import axios from 'axios';

const fetchVehicleTypes = async (numberOfWheels) => {
  try {
    const response = await axios.get(`/api/vehicle/numberOfWheels=${numberOfWheels}`);
    return response.data; // Array of vehicle types
  } catch (error) {
    console.error('Error fetching vehicle types:', error);
    return [];
  }
};

// Example component where you want to fetch vehicle models based on selected vehicle type

const fetchVehicleModels = async (vehicleType) => {
  try {
    const response = await axios.get(`/api/vehicle/models?vehicleType=${vehicleType}`);
    return response.data; // Array of vehicle models
  } catch (error) {
    console.error('Error fetching vehicle models:', error);
    return [];
  }
};


export  {
    fetchVehicleTypes,
    fetchVehicleModels
};
